import React,{FC} from 'react';
import Icon from '../res/reloadIcon.ico';

const ReloadIcon:FC = () => {
    return (
        <img src={Icon} style={{
            width:'14px',
            height:'14px',
            color:'white'
        }} />
    );
};

export default ReloadIcon;
